import * as React from 'react';
import { useNavigate } from 'react-router-dom';
import '../App.css';
import logo from '../assets/logo.png';

function LeftNav() {
  const navigate = useNavigate();
  const pages = ['Home', 'BTi', 'Slido', 'Tetro'];
  const pages1 = ['H', 'B', 'S', 'T'];

  return <>
    <nav className="left sideNav d-flex flex-column">
      <div style={{textAlign:'center'}} ><img src={logo} style = {{height:'50px', width: '50px' , margin:'15px', top:'0px'}} alt=""></img> </div>
        <ul style={{listStyleType:"none"}}>
            <li>Home</li>
            <li>Tictac</li>
            <li>Tower</li>
            <li>Snek</li>
        </ul>
    </nav>
  </>

}
export default LeftNav;
